  return (
    <Routes>
      <Route path={'/'} element={<Layout/>}>
      <Route index element={
        <Post />
      }/>
      <Route path= {'/login'} element={
          <div>login page</div>        
      }/>
      </Route>

    </Routes> 
  );
}

export default App;
